import { Link } from "react-router-dom";

function Login() {
    return (
        <>
            <div className="back_ground">
                <div className="back_rectangle">
                    <div className="back_title">
                        <img src="/title.png" width='30%' />
                    </div>
                </div>
                <div className="login_rectangle">
                    <input type='text' className="input_id" placeholder="Enter i'd" />
                    <div>
                        <a href="/">아이디를 잊어버렸어요.</a>
                    </div>
                    <input type='text' className="input_password" placeholder="Enter password" />
                </div>
            </div>
        </>
    )
};

export default Login;
